import React, { Component } from 'react';
import Video from '../assets/Data/videos.json';

class Videos extends Component {


    render() {
        console.log(Video[0]);
        return (
            <div className='video'>
                <div className='video__player'></div>
            </div>
        )
    }
}

export default Videos;
